  <script>
    document.addEventListener("DOMContentLoaded", () => {
      const hamburgerMenu = document.getElementById("hamburger-menu");
      const mainMenu = document.querySelector(".main-menu");

      // Toggle hamburger menu visibility and rotation
      hamburgerMenu.addEventListener("click", (e) => {
        e.stopPropagation(); // Prevent clicks from propagating
        mainMenu.classList.toggle("show");
        hamburgerMenu.classList.toggle("hidenav");
      });

      // Hide menu when clicking outside of it
      document.addEventListener("click", (e) => {
        if (!mainMenu.contains(e.target) && !hamburgerMenu.contains(e.target)) {
          mainMenu.classList.remove("show");
          hamburgerMenu.classList.remove("hidenav");
        }
      });
    });

    document.addEventListener('DOMContentLoaded', () => {
            const navText = document.querySelector('.nav-text');
            const arrow = document.querySelector('.arrow');
            const dropdownOptions = document.querySelector('.dropdown-options');

            if (navText && arrow && dropdownOptions) {
                const toggleDropdown = (e) => {
                    e.stopPropagation();
                    dropdownOptions.classList.toggle('show');
                    arrow.classList.toggle('rotate');
                };

                navText.addEventListener('click', toggleDropdown);
                arrow.addEventListener('click', toggleDropdown);

                const optionItems = document.querySelectorAll('.dropdown-options p');
                optionItems.forEach((option, index) => {
                    option.addEventListener('click', () => {
                        const pages = ['profiledash.php', 'consultantlogin.php'];
                        window.location.href = pages[index];
                    });
                });

                document.addEventListener('click', (e) => {
                    if (!dropdownOptions.contains(e.target) && !navText.contains(e.target) && !arrow.contains(e.target)) {
                        dropdownOptions.classList.remove('show');
                        arrow.classList.remove('rotate');
                    }
                });
            }
        });
  </script>
